import "./Slide.css";

 

export default function Slide(props) {
 

	const {name,image,count}=props.categories
	return (
		<>
			<div className="item">
				<div className="category-item">
				 
						<img
							className="img-fluid custom-slick-img"
							src={ image.id}
							 alt={image.alt}
							 id={image.id}
					 />
						<h6>
							 {name}
							 {
								 console.log("products categories:",image.src )
							 }
						</h6>
						<p> {count}</p>
				 
				</div>
			</div>
		</>
	);
}
